        s_10 += msg.value;
    }

    function withdraw() public {
        uint256 amount = s_11[msg.sender];
        require(amount > 0, "Nothing to withdraw");
        s_11[msg.sender] = 0;
        msg.sender.call{value: amount}("");
    }

    function exit() public {
        uint256 amount = s_11[msg.sender];
        require(amount > 0, "Nothing to exit");
        s_11[msg.sender] = 0;
        msg.sender.call{value: amount}("");
    }

    function sell(uint256 arg1) public {
        require(arg1 > 0 && arg1 <= s_11[msg.sender], "Invalid sell arguments");
        expectedfunds -= (0x204fce5e3e25026110000000 * arg1) / 0xde0b6b3a7640000;
        s_11[msg.sender] -= arg1;
        s_10 = (s_10 * (totalsupply - arg1)) / totalsupply;
        totalsupply -= arg1;
    }

    function transfer(bytes memory arg1) public {
        require(arg1.length > 0 && s_11[msg.sender] > 0, "Invalid transfer arguments");
        expectedfunds -= (0x204fce5e3e25026110000000 * s_11[msg.sender]) / 0xde0b6b3a7640000;
        s_11[msg.sender] = 0;
        s_10 = (s_10 * (totalsupply - s_11[msg.sender])) / totalsupply;
        totalsupply -= s_11[msg.sender];
    }
}
